//pages/Nav.js
import React from "react";
import EventTable from "./contents/eventAndFestival/eventTable";
import HeaderMain from "./contents/header/headerMain";
import HeaderMenu from "./contents/header/headerMenu";
import './contents/eventAndFestival/eventAndFestivalPage.css';

function eventAndFestival() {
  let isEvent;


  function clickEvent() {
    console.log("clic");
    return(
        <div className="eventAndFestivalPageMain">
        <div id="header">
          <HeaderMain />
          <HeaderMenu />
        </div>
        <button id="selectEvent" onClick = {clickEvent}> 공연 행사 </button>
        <button id="selectFest"> 문화 축제 </button>
        <div id="eventTable">
          <EventTable event = "true" ></EventTable>;
        </div>
      </div>
    );
  }

  function clickCulture() {
    console.log("clic");
    return(
        <div className="eventAndFestivalPageMain">
        <div id="header">
          <HeaderMain />
          <HeaderMenu />
        </div>
        <button id="selectEvent" onClick = {clickEvent}> 공연 행사 </button>
        <button id="selectFest" onClick = {clickCulture}> 문화 축제 </button>
        <div id="eventTable">
          <EventTable event="false"></EventTable>;
        </div>
      </div>
    );
  }

  return (
    <div className="eventAndFestivalPageMain">
      <div id="header">
        <HeaderMain />
        <HeaderMenu />
      </div>
      <button id="selectEvent" onClick = {clickEvent}> 공연 행사 </button>
      <button id="selectFest" onClick = {clickCulture}> 문화 축제 </button>
      <div id="eventTable">
        <EventTable event="true"></EventTable>;
      </div>
    </div>
  );
}

export default eventAndFestival;
